import React from 'react';
import { Box, Button, Typography, Card, CardContent, Stack } from '@mui/material';
import LocalHospitalIcon from '@mui/icons-material/LocalHospital';
import PersonIcon from '@mui/icons-material/Person';
import { useHistory } from 'react-router-dom';

export default function AuthHome() {
  const history = useHistory();

  return (
    <Box 
      sx={{ 
        minHeight: '100vh',
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center',
        background: 'radial-gradient(circle at 50% 50%, #23272f 0%, #181a20 100%)',
        position: 'relative',
        overflow: 'hidden',
        p: { xs: 2, sm: 4 }
      }}
    >
      {/* Efeitos de background */}
      <Box sx={{
        position: 'absolute',
        top: 0,
        left: 0,
        right: 0,
        bottom: 0,
        overflow: 'hidden',
        '&::before': {
          content: '""',
          position: 'absolute',
          top: '50%',
          left: '50%',
          width: '200%',
          height: '200%',
          background: 'radial-gradient(circle at center, rgba(33, 150, 243, 0.15) 0%, transparent 50%)',
          transform: 'translate(-50%, -50%)',
          animation: 'rotate 30s linear infinite',
        },
        '&::after': {
          content: '""',
          position: 'absolute',
          top: 0,
          left: 0,
          right: 0,
          bottom: 0,
          background: 'url("data:image/svg+xml,%3Csvg width="60" height="60" viewBox="0 0 60 60" xmlns="http://www.w3.org/2000/svg"%3E%3Cg fill="none" fill-rule="evenodd"%3E%3Cg fill="%239BA9B4" fill-opacity="0.05"%3E%3Cpath d="M36 34v-4h-2v4h-4v2h4v4h2v-4h4v-2h-4zm0-30V0h-2v4h-4v2h4v4h2V6h4V4h-4zM6 34v-4H4v4H0v2h4v4h2v-4h4v-2H6zM6 4V0H4v4H0v2h4v4h2V6h4V4H6z"/%3E%3C/g%3E%3C/g%3E%3C/svg%3E")',
        }
      }} />

      <Card 
        sx={{ 
          maxWidth: 480,
          width: '100%',
          background: 'rgba(30,34,44,0.96)',
          backdropFilter: 'blur(20px)',
          borderRadius: 6,
          border: '1px solid rgba(255,255,255,0.1)',
          boxShadow: '0 8px 32px 0 rgba(0,0,0,0.4)',
          position: 'relative',
          overflow: 'hidden',
          '&::before': {
            content: '""',
            position: 'absolute',
            top: 0,
            left: '-50%',
            width: '200%',
            height: '4px',
            background: 'linear-gradient(90deg, transparent, rgba(33, 150, 243, 0.6), transparent)',
            animation: 'shimmer 4s infinite linear'
          }
        }}
      >
        <CardContent sx={{ p: { xs: 3, sm: 5 } }}>
          <Stack spacing={4} alignItems="center">
            <Box sx={{ textAlign: 'center', mb: 2 }}>
              <Typography 
                variant="h3" 
                component="h1" 
                fontWeight={800} 
                sx={{ 
                  mb: 2,
                  background: 'linear-gradient(135deg, #fff 0%, #b0b8c1 100%)',
                  backgroundClip: 'text',
                  WebkitBackgroundClip: 'text',
                  WebkitTextFillColor: 'transparent',
                  letterSpacing: '-0.5px'
                }}
              >
                Bem-vindo ao<br />App Sacados
              </Typography>
              <Typography 
                color="#b0b8c1" 
                sx={{ 
                  fontSize: { xs: 16, sm: 18 },
                  maxWidth: 320,
                  mx: 'auto',
                  opacity: 0.8
                }}
              >
                Escolha seu perfil para continuar:
              </Typography>
            </Box>

            <Stack spacing={2} sx={{ width: '100%' }}>
              <Button
                variant="contained"
                size="large"
                startIcon={
                  <Box 
                    sx={{ 
                      background: 'rgba(255,255,255,0.2)',
                      borderRadius: '12px',
                      p: 1,
                      display: 'flex'
                    }}
                  >
                    <LocalHospitalIcon sx={{ fontSize: 24 }} />
                  </Box>
                }
                sx={{
                  py: 2.5,
                  px: 3,
                  borderRadius: 3,
                  background: 'linear-gradient(135deg, #1976d2 0%, #1565c0 100%)',
                  fontSize: 18,
                  fontWeight: 600,
                  justifyContent: 'flex-start',
                  '&:hover': {
                    background: 'linear-gradient(135deg, #1e88e5 0%, #1976d2 100%)',
                    transform: 'translateY(-2px)',
                    boxShadow: '0 6px 20px rgba(25,118,210,0.4)'
                  },
                  transition: 'all 0.3s ease'
                }}
                onClick={() => history.push('/cadastro-clinica')}
              >
                Sou Clínica
              </Button>

              <Button
                variant="outlined"
                size="large"
                startIcon={
                  <Box 
                    sx={{ 
                      background: 'rgba(255,255,255,0.1)',
                      borderRadius: '12px',
                      p: 1,
                      display: 'flex'
                    }}
                  >
                    <PersonIcon sx={{ fontSize: 24 }} />
                  </Box>
                }
                sx={{
                  py: 2.5,
                  px: 3,
                  borderRadius: 3,
                  borderColor: 'rgba(255,255,255,0.2)',
                  color: '#fff',
                  fontSize: 18,
                  fontWeight: 600,
                  justifyContent: 'flex-start',
                  '&:hover': {
                    borderColor: '#2196f3',
                    background: 'rgba(33,150,243,0.08)',
                    transform: 'translateY(-2px)'
                  },
                  transition: 'all 0.3s ease'
                }}
                onClick={() => history.push('/cadastro-paciente')}
              >
                Sou Paciente
              </Button>
            </Stack>

            <Typography 
              component="a"
              href="/login"
              sx={{ 
                color: '#90caf9',
                textDecoration: 'none',
                fontSize: 15,
                fontWeight: 500,
                '&:hover': {
                  color: '#42a5f5',
                  textDecoration: 'underline'
                },
                cursor: 'pointer'
              }}
              onClick={(e) => {
                e.preventDefault();
                history.push('/login');
              }}
            >
              Já tenho uma conta
            </Typography>
          </Stack>
        </CardContent>
      </Card>
    </Box>
  );
}
